import React, { useState } from 'react';
import Head from 'next/head';
import { AppProps } from 'next/app';



class Modal extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      counters: 0,
      create: "thanh"
    }
  }
  render() {

    return (
      <div className="container">
        <div className="modal fade" id="myModal" role="dialog">
          <div className="modal-dialog">
            {/* Modal content*/}
            <div className="modal-content">
              <div className="modal-header" style={{ padding: '35px 50px' }}>
                <button type="button" className="close" data-dismiss="modal">Ã—</button>
                <h4><span className="glyphicon glyphicon-lock" /> Login</h4>
              </div>
              <div className="modal-body" style={{ padding: '40px 50px' }}>
                <form role="form">
                  <div className="form-group">
                    <label htmlFor="usrname"><span className="glyphicon glyphicon-user" /> Username</label>
                    <input type="text" className="form-control" id="usrname" placeholder="Enter email" />
                  </div>
                  <div className="form-group">
                    <label htmlFor="psw"><span className="glyphicon glyphicon-eye-open" /> Password</label>
                    <input type="text" className="form-control" id="psw" placeholder="Enter password" />
                  </div>
                  <div className="checkbox">
                    <label><input type="checkbox" defaultValue defaultChecked />Remember me</label>
                  </div>
                  <button type="submit" className="btn btn-success btn-block"><span className="glyphicon glyphicon-off" /> Login</button>
                </form>
              </div>
              <div className="modal-footer">
                <button type="submit" className="btn btn-danger btn-default pull-left" data-dismiss="modal"><span className="glyphicon glyphicon-remove" /> Cancel</button>
                <p>Not a member? <a href="#">Sign Up</a></p>
                <p>Forgot <a href="#">Password?</a></p>
              </div>
            </div>
          </div>
        </div>
      </div>
    )
  }
}
export default Modal;
